DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增长id',
  `title` varchar(512) DEFAULT NULL COMMENT '文章标题',
  `image_small` varchar(512) DEFAULT NULL COMMENT '小图url',
